schemaDefinition: "create or replace view SPM_NODE_QUOTA(\n\t\"SPMNodeQuotaValue\"\
  ,\n\t\"SPMNodeQuotaQuarter\",\n\t\"SPMNodeQuotaTerritoryType\",\n\t\"SPMNodeQuotaTerritoryName\"\
  ,\n\t\"SPMNodeQuotaCountry\",\n\t\"SPMNodeQuotaRegion\",\n\t\"SPMNodeQuotaArea\"\
  ,\n\t\"SPMNodeQuotaGeo\",\n\t\"SPMNodeQuotaTerritorySysID\",\n\t\"SPMNodeQuotaDistrict\"\
  ,\n\t\"SPMNodeSourcedQuotaValue\",\n\t\"SPFlag\"\n) as -- SEMANTIC LAYER BEGINS\n\
  \nSELECT \"QUOTA\" as \"SPMNodeQuotaValue\",\n       \"QUARTER\" as \"SPMNodeQuotaQuarter\"\
  ,\n       \"TERRITORYTYPE\" as \"SPMNodeQuotaTerritoryType\",\n       \"TERRITORYNAME\"\
  \ as \"SPMNodeQuotaTerritoryName\",\n       \"COUNTRY\" as \"SPMNodeQuotaCountry\"\
  ,\n       \"REGION\" as \"SPMNodeQuotaRegion\",\n       \"AREA\" as \"SPMNodeQuotaArea\"\
  ,\n       \"GEO\" as \"SPMNodeQuotaGeo\",\n       \"TERRITORYSYSID\" as \"SPMNodeQuotaTerritorySysID\"\
  ,\n       \"DISTRICT\" as \"SPMNodeQuotaDistrict\",\n       \"SOURCEDQUOTA\" as\
  \ \"SPMNodeSourcedQuotaValue\",\n       \"SERVICEPROVIDERFLAG\" as \"SPFlag\"\n\
  FROM\n  (SELECT \"TERRITORYSYSID\" as \"TERRITORYSYSID\",\n          \"GEO\" as\
  \ \"GEO\",\n          \"AREA\" as \"AREA\",\n          \"REGION\" as \"REGION\"\
  ,\n          \"COUNTRY\" as \"COUNTRY\",\n          \"TERRITORYNAME\" as \"TERRITORYNAME\"\
  ,\n          \"TERRITORYTYPE\" as \"TERRITORYTYPE\",\n          \"QUARTER\" as \"\
  QUARTER\",\n          \"QUOTA\" as \"QUOTA\",\n          \"DISTRICT\" as \"DISTRICT\"\
  ,\n          \"SOURCEDQUOTA\" as \"SOURCEDQUOTA\",\n          \"SERVICEPROVIDERFLAG\"\
  \ as \"SERVICEPROVIDERFLAG\"\n   FROM RDS.SURF.TBLSPMNODEQUOTA)Projection_2;"
